import ManageSearchIcon from '@mui/icons-material/ManageSearch';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';

export const  SidebarData = [
  {
      title: "Streaming Services",
      icon: <AppsIcon />
